import USFlag from "./../assets/images/US Flag.svg";
import Calendar from "./../assets/images/calendar.svg";
import PosterBackground from "./../assets/images/poster-background.png";
import Logo from "./../assets/logo.png";
import sdiLogo from "./../assets/sdi_logo.svg";

import SafeAndSecure from "../assets/icons/how-it-works/safe-and-secure.svg";
import FastAssessment from "./../assets/icons/how-it-works/fast-assessment.svg";
import AIResult from "../assets/icons/how-it-works/AI-result.svg";
import Compliance from "../assets/icons/how-it-works/compliance.svg";

import HomePoster from "../assets/images/home-poster.png";
import RegisterPoster from "../assets/images/register-poster.png";
import AntigenTestPoster from "../assets/images/antigen.png";
import RTPCRTestPoster from "../assets/images/rtpcr.png"

// @ts-ignore
import {ReactComponent as LeftArrow} from "./../assets/icons/chevron-left.svg";
// @ts-ignore
import {ReactComponent as Dial} from "./../assets/icons/dial.svg";
// @ts-ignore
import LoadingGif from "./../assets/images/eclipse.gif"
import InfoIcon from "../assets/icons/info-icon.png"

export {
    Logo,
    USFlag,
    Calendar,
    LeftArrow,
    RegisterPoster,
    PosterBackground,
    AntigenTestPoster,
    RTPCRTestPoster,
    SafeAndSecure,
    FastAssessment,
    AIResult,
    Compliance,
    HomePoster,
    Dial,
    LoadingGif,
    sdiLogo,
    InfoIcon
}
